%[text] 绘制分泳道的热图
%[text] 热图是一种简单直观呈现NTATS的方法。每组表现为一个泳道，泳道内是一张热图，用渐变颜色表示数值大小。
%[text] ## 语法
%[text] ```matlabCodeExample
%[text] [Layout,Axes]=UniExp.LanearHeatmap(NTATS);
%[text] %采用默认参数绘制NTATS热图
%[text] 
%[text] [Layout,Axes]=UniExp.LanearHeatmap(Array);
%[text] %也支持使用原始数组作图
%[text] 
%[text] [Layout,Axes]=UniExp.LanearHeatmap(CellData);
%[text] %使用元胞数组绘制不对齐的泳道
%[text] 
%[text] [Layout,Axes]=UniExp.LanearHeatmap(StructData);
%[text] %使用结构体标量绘制不对齐的具名泳道
%[text] 
%[text] ___=UniExp.LanearHeatmap(___,Name=Value);
%[text] %与上述任意语法组合使用，额外指定名称值参数
%[text] ```
%[text] ## 示例
%[text] ```matlabCodeExample
%[text] load('+UniExp\LanearHeatmap.mat');
%[text] figure;
%[text] UniExp.LanearHeatmap(NTATS,Flags=UniExp.Flags.HideYAxis,ImagescStyle={'XData',[-2,14]},Layout=tiledlayout(2,3,TileSpacing='tight',Padding='tight'));
%[text] CB=colorbar;
%[text] CB.Layout.Tile='east';
%[text] CB.Label.String='ΔF/F_0';
%[text] CB.TickLabels=round(2.^str2double(CB.TickLabels)-1,1);
%[text] MATLAB.Graphics.FigureAspectRatio(8,5,MATLAB.Flags.Narrow);
%[text] ```
%[text] ![untitled.png](text:image:20d3)
%[text] ## 输入参数
%[text] NTATS(:,:,:)MATLAB.DataTypes.NDTable，作图数据，第1维细胞，第2维时间，第3维分组。将为每组对应一个泳道，泳道内第1维是细胞，第2维是时间。一般应从HeatmapSort的返回值中取得。
%[text] Array(:,:,:)，原始数组，第1维细胞，第2维时间，第3维分组。将为每组对应一个泳道，泳道内第1维是细胞，第2维是时间。一般应从HeatmapSort的返回值中取得。
%[text] CellData(:,:)cell，可以在元胞中放置尺寸不同的数组。如果不指定Layout，将使用元胞数组的布局。
%[text] StructData(1,1)struct，可以用结构体的成员放置尺寸不同的数组。如果不指定SubTitles，将用结构体字段名作为每个泳道的小标题
%[text] ### 名称值参数
%[text] #### XData(1,2)
%[text] X轴坐标范围，热图将被缩放到这个范围内
%[text] #### YData(1,2)
%[text] Y轴坐标范围，热图将被缩放到这个范围内
%[text] #### ImagescStyle(1,:)cell=cell(1,0)
%[text] 本函数调用imagesc绘图，此处指定要传递给imagesc的其它参数。
%[text] #### LMHColor(3,3)double=\[0,0.5,0;1,1,1;1,0,1\]
%[text] 指定最小、0、最大三个数值大小节点的颜色，其它数值将执行插值，得到颜色映射表。
%[text] 如果指定了ScaleColor旗帜，将使用平方根插值而不是线性插值。
%[text] 如果数据最大值的绝对值大于最小值的绝对值，最小颜色将不会出现在图上，最小值将用最小色和0色之间的某个颜色表示，以确保线性插值斜率均等；如果最大值的绝对值小于最小值的绝对值，反之亦然。要改变这种行为，指定SymmetricColormap旗帜，以使最大值和最小值一定对应最大色和最小色；但这将使得正数段和负数段的颜色梯度不同。
%[text] #### SubTitles(1,:)string
%[text] 每个泳道的小标题。如不指定，将查找NTATS.Dimensions.IndexNames{3}或fieldnames(StructData)作为小标题，如果也为空，就不显示小标题。
%[text] #### Layout(1,1)matlab.graphics.layout.TiledChartLayout
%[text] 指定泳道布局对象，可用tiledlayout函数取得。如果不指定此参数，布局将是未定义的（特别地，如果指定了CellData，将使用输入元胞数组的布局）
%[text] #### TitleArguments(1,:)cell={'Interpreter','none'}
%[text] 用于显示泳道小标题的其它格式参数，将传递给内置title函数。
%[text] #### CLim(1,2)
%[text] 颜色棒对应的数值范围。如果不指定此参数，将采用所有泳道的最小值和最大值作为数值范围。
%[text] #### Flags(1,:)UniExp.Flags
%[text] 指定功能旗帜，可选以下旗帜任意组合：
%[text] - HideXAxis，隐藏X轴
%[text] - HideYAxis，隐藏Y轴
%[text] - ScaleColor，扭曲颜色图，使得较小数值获得较大对比度
%[text] - SymmetricColormap，采用对称颜色图，确保从高到低颜色梯度保持一致。如果不指定此参数，将强制最大正值对应到最大色，最小负值对应到最小色，这可能会导致正数段与负数段颜色梯度不同。 \
%[text] ## 返回值
%[text] Layout(1,1)matlab.graphics.layout.TiledChartLayout，泳道布局对象，可用于作图后期修饰
%[text] Axes(:,:)matlab.graphics.axis.Axes，每个泳道的坐标轴对象，可用于作图后期修饰。注意，第1维对应泳道布局水平排列，第2维对应泳道布局垂直分行。
%[text] **See also** [UniExp.HeatmapSort](<matlab:doc UniExp.HeatmapSort>) [UniExp.Flags](<matlab:edit UniExp.Flags>) [imagesc](<matlab:doc imagesc>) [tiledlayout](<matlab:doc tiledlayout>) [MATLAB.DataTypes.NDTable](<matlab:doc MATLAB.DataTypes.NDTable>) [title](<matlab:doc title>)
function [Layout,Axes]=LanearHeatmap(Data,options)
arguments
	Data
end
arguments
	options.ImagescStyle=cell(1,0)
    options.LMHColor=[0,0.5,0;1,1,1;1,0,1];
	options.SubTitles
	options.TitleArguments={'Interpreter','none'}
	options.CLim
	options.Flags=UniExp.Flags.empty(1,0)%Flags不能作为重复参数，会与名称值参数冲突
	options.Layout
	options.XData
	options.YData
end
HasFlags=num2cell(ismember([UniExp.Flags.HideXAxis,UniExp.Flags.HideYAxis,UniExp.Flags.ScaleColor,UniExp.Flags.SymmetricColormap],options.Flags));
[HideXAxis,HideYAxis,ScaleColor,SymmetricColormap]=HasFlags{:};
HasSubTitles=isfield(options,'SubTitles');
IsNDTable=isa(Data,'MATLAB.DataTypes.NDTable');
IsStruct=isstruct(Data);
if HasSubTitles
	SubTitles=options.SubTitles;
elseif IsNDTable&&height(Data.Dimensions)>=3
	SubTitles=Data.Dimensions.IndexNames{3};
	HasSubTitles=~isempty(SubTitles);
elseif IsStruct
	SubTitles=fieldnames(Data);
	HasSubTitles=true;
end
if IsStruct
	Data=reshape(struct2cell(Data),1,[]);
elseif IsNDTable
	Data=Data.Data;
end
CellData=iscell(Data);
if CellData
	NumLanes=numel(Data);
else
	NumLanes=size(Data,3);
end
if isfield(options,'CLim')
	Min=options.CLim(1);
	Max=options.CLim(2);
elseif CellData
	LinearData=cellfun(@(D)D(:),Data,UniformOutput=false);
	[Min,Max]=bounds(vertcat(LinearData{:}));
else
	[Min,Max]=bounds(Data,'all');
end
Limit=[Min,Max];
Steps=linspace(Min,Max,256);
LMHColor=options.LMHColor;
LowSteps=Steps(Steps<0)';
HighSteps=Steps(Steps>0)';
if SymmetricColormap&&Min<0&&Max>0
	if Max+Min>0
		LMHColor(1,:)=(LMHColor(2,:)*(Max+Min)-LMHColor(1,:)*Min)/Max;
	elseif Max+Min<0
		LMHColor(3,:)=(LMHColor(3,:)*Max-LMHColor(2,:)*(Min+Max))/Min;
	end
end
if isempty(LowSteps)
	Colormap=MATLAB.ElMat.LinSpace(LMHColor(2,:),LMHColor(3,:),numel(HighSteps),1);
else
	if ScaleColor
		Colormap=[interp2(1:3,LowSteps,MATLAB.ElMat.LinSpace(LMHColor(1,:),LMHColor(2,:),numel(LowSteps),1),1:3,rescale(-sqrt(-LowSteps),min(LowSteps),max(LowSteps)));interp2(1:3,HighSteps,MATLAB.ElMat.LinSpace(LMHColor(2,:),LMHColor(3,:),numel(HighSteps),1),1:3,rescale(sqrt(HighSteps),min(HighSteps),max(HighSteps)))];
	else
		Colormap=[interp2(1:3,LowSteps,MATLAB.ElMat.LinSpace(LMHColor(1,:),LMHColor(2,:),numel(LowSteps),1),1:3,rescale(LowSteps,min(LowSteps),max(LowSteps)));interp2(1:3,HighSteps,MATLAB.ElMat.LinSpace(LMHColor(2,:),LMHColor(3,:),numel(HighSteps),1),1:3,rescale(HighSteps,min(HighSteps),max(HighSteps)))];
	end
end
%防止浮点误差造成的范围外数值
Colormap=clip(Colormap,0,1);
RealAxes=gobjects(NumLanes,1);
if isfield(options,'Layout')
	Layout=options.Layout;
elseif CellData
	Layout=size(Data);
	Layout=tiledlayout(Layout(1),Layout(2),TileSpacing='tight',Padding='tight');
else
	Layout=tiledlayout('flow',TileSpacing='tight',Padding='tight');
end
NeedXYData=isfield(options,["XData","YData"]);
XYData={};
if NeedXYData(1)
	XYData{1}=options.XData;
elseif ~CellData
	XYData{1}=[1,width(Data)];
end
if NeedXYData(2)
	XYData{2}=options.XData;
elseif ~CellData
	XYData{2}=[1,height(Data)];
end
if CellData
	NeedXYData=~NeedXYData;
end
for L=1:NumLanes
	Ax=nexttile(Layout);
	if CellData
		Lane=Data{L};
		if NeedXYData(1)
			XYData{1}=[1,width(Lane)];
		end
		if NeedXYData(2)
			XYData{2}=[1,height(Lane)];
		end
	else
		Lane=Data(:,:,L);
	end
	imagesc(XYData{:},Lane,options.ImagescStyle{:});
	clim(Ax,Limit);
	if HideXAxis
		Ax.XAxis.Visible="off";
	end
	if HideYAxis
		Ax.YAxis.Visible="off";
	end
	box off
	Ax.TickDir='out';
	colormap(Ax,Colormap);
	if HasSubTitles
		title(SubTitles(L),options.TitleArguments{:});
	end
	RealAxes(L)=Ax;
end
drawnow;
Axes=gobjects(Layout.GridSize)';
Axes(1:NumLanes)=RealAxes;
end

